  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115172 includes chemical,
  discrete sample, meteorological, physical, profile and underway - surface data collected
  from THOMAS G. THOMPSON in the Coastal Waters of SE Alaska, Gulf of Alaska and North
  Pacific Ocean from 1993-05-15 to 1993-06-26 and retrieved during cruise 325021/1
  and WOCE_P17N. These data include ALKALINITY, BAROMETRIC PRESSURE, CARBON DIOXIDE
  - AIR, CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-12 (CFC-12), DELTA CARBON-13,
  DELTA CARBON-14, DELTA HELIUM-3, DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, HELIUM,
  HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE, Partial pressure (or fugacity)
  of carbon dioxide, Potential temperature (theta), SALINITY, SEA SURFACE TEMPERATURE,
  SILICATE, Tritium (Hydrogen isotope) and WATER TEMPERATURE. The instruments used
  to collect these data include CTD, Carbon dioxide (CO2) gas analyzer, Shower head
  chamber equilibrator for autonomous carbon dioxide (CO2) measurement and bottle.
  These data were collected by Catherine Goyet of University of Perpignan via Domitia;
  Institute of Modeling and Analysis of Geo-Environment and Health as part of the
  WOCE P17N and WOCE_P17N data set.nnThe World Ocean Circulation Experiment (WOCE)
  was a major component of the World Climate Research Program with the overall goal
  of better understanding the ocean's role in climate and climatic changes resulting
  from both natural and anthropogenic causes. The CO2 survey took advantage of the
  sampling opportunities provided by the WOCE Hydrographic Program (WHP) cruises during
  this period between 1990 and 1998. The final collection covers approximately 23,000
  stations from 94 WOCE cruises.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
